import React from "react";
import './education.css';


export function Education(){
    return (
        <>  
            <h1 className="educationhead text-center" id="educate_head">Educational Details</h1>
            <div className="row container-fluid" id="educationdiv">
                <div class="card col-lg-3">
                    
                    <div class="card-body text-center">
                        <p class="card-title">B.Sc Inforation Technology</p>
                        <h1 class="card-text">Completed Year : 2016 -2019</h1>
                        
                    </div>
                </div>
            </div>
        </>
    );
}
